import React from "react"
import Flexbox from "flexbox-react"

import "./Chatbot.css"

function Chatbot (props) {
  return (
    <div>
      <Flexbox className="chatbot-flexbox" flexDirection="row">
        <Flexbox className="channels-flexbox" flexGrow={1}>
          <Channels channels={props.data}/>
        </Flexbox>
        <Flexbox className="chats-flexbox" flexGrow={5}>
          <Chats />
        </Flexbox>
      </Flexbox>
    </div>
  )
}

function Channels (props) {
  const channels = props.channels
  const listChannels = channels.map((channel, index) =>
    <li key={channel.id}>
      <Channel channel={channel} />
    </li>
  )
  return (
    <Flexbox className="channels" flexDirection="column">
      <div className="channel-header">
        Channellist
      </div>
      <ul className="channel-list">
        {listChannels}
      </ul>
    </Flexbox>
  )
}

const Channel = props => (
  <button className="channel-button">
    <div>
      {props.channel.title}
    </div>
    <div>
      status: {props.channel.status}
    </div>
  </button>
)

function Chats () {
  const items = [...Array(100)].map((val, i) => `Item ${i}`)
  return (
    <Flexbox className="chats" flexDirection="column">
      <div className="chat-header">
        Chats
      </div>
      <Flexbox>
        <div className="chat-list">
          <ul>
            {/* {items.map((item, i) => (<li key={`item_${i}`}>{ item }</li>))} */}
          </ul>
        </div>
      </Flexbox>
      <div className="chat-textfield">
        Textfield
      </div>
    </Flexbox>
  )
}

export default Chatbot
